    def pdfsaver(self):
        file_name = self.lineEdit.text()
        pathh = Path('E:/Pant Coat Sizes/'+file_name+'.png')
        window = pygetwindow.getWindowsWithTitle('Form')[0]
        x1 = window.left
        y1 = window.top
        height = (window.height)
        width = window.width
        x2 = x1 + width
        y2 = y1 + height
        pyautogui.screenshot(pathh)
        im = Image.open(pathh)
        im = im.crop((x1, y1, x2, y2))
        im.save(pathh)
        im1 = Image.open("maybefinal.PNG")
        im2 = Image.open('E:/Pant Coat Sizes/'+file_name+'.png')
        back_im = im2.copy()
        back_im.paste(im1, (1,1))
        back_im.save('E:/Pant Coat Sizes/'+file_name+'.png', quality=95)
        im3 = Image.open("finalBottom.PNG")
        im2 = Image.open('E:/Pant Coat Sizes/'+file_name+'.png')
        back_im = im2.copy()
        back_im.paste(im3,(-100, 800))
        back_im.save('E:/Pant Coat Sizes/'+file_name+'.png', quality=95)

        pdf = Image.open(pathh)
        pathh_for_save = Path('E:/Pant Coat Sizes/'+file_name+'.pdf')
        pdf.save(pathh_for_save)
        os.remove(pathh)

